import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Navbar from './Navbar';
import AllTreks from './AllTreks';


function Landing() {
  return (
    <div className='main-container'>
      <Header />
      <Navbar></Navbar>
      <AllTreks></AllTreks>
      <Footer />
    </div>
  );
}

export default Landing;
